const  Regiones = () =>{
    const [equipo, setEquipo] = React.useState([])
 React.useEffect(()=>{
     obtenerDatos()

 },[])
 const obtenerDatos = async() =>{
     const data = await fetch('http://127.0.0.1:8000/welcome')  
     const users = await data.json()
     setEquipo(users)  
 }
    return(

        <div>
            <h1 class="text-center text-primary"> Regiones</h1>
            <table class="table table-bordered stacktable table-sm">
                <thead>
                    <tr>
                        <th scope="col">nombre</th>
                    </tr>


                </thead>
                <tbody>{
equipo.map(item => (
<tr>
    <th scope="row" key={item.id}> {item.nombre}</th>
<td>{item.nombre}</td></tr>))}



                </tbody>

            </table>
        </div>
    )




}
export default Region;
